  false,\n\t\"url\": null,\n\t\"notes\": \"In the September 2, 2003, Environmental
  Assessment, the U.S. Fish and Wildlife Service (Service) considered the environmental
  effects of acquiring 4,004 acres (+1-) in Jefferson and Whitefield, New Hampshire,
  and adding them to the Pondicherry Division, a Special Focus Area for resource protection
  within the Silvio O. Conte National Fish and Wildlife Refuge (NFWR).  The Environmental
  Assessment also contains pre-acquisition Compatibility Determinations to allow the
  continuation of wildlife-dependent and compatible public uses, such as hunting,
  fishing, wildlife observation and photography, and environmental education and interpretation.
  A range of issues and concerns were identified during the public involvement process.
  These were considered in conjunction with refuge purposes, the purpose of and need
  for the proposal, and the refuge goals and objectives in developing alternatives
  and evaluating their impacts. Copies of the.Environmental Assessment documents were
  sent to the eight landowners within the proposed acquisition area, as well as those
  landowners adjacent to the project. Copies were also sent to local and State officials,
  Congressional representatives, and all individuals who requested copies of the documents.\",\n\t\"owner_org\":
